import React from 'react';
import { cpus } from 'os';

const Card = (props) => {
    const cWidth = 485;
    const cHeight = 300;
    const cPadding = 10;
    const cHeadFoot = 0.1;

    return (
        <div class>
            <div style={{
                backgroundColor: 'chocolate',
                color: 'cornsilk',
                position: 'absolute',
                top: 0,
                width: cWidth-cPadding*2,
                height: cHeight*cHeadFoot-cPadding*2,
                padding: cPadding,
                textAlign: 'center',
            }}>Card Title
            </div>
            <div style={{
                backgroundColor: 'wheat',
                color: 'chocolate',
                position: 'absolute',
                top: cHeight * cHeadFoot,
                width: cWidth-cPadding*2,
                padding: cPadding,
                height: cHeight*(1-cHeadFoot*2)-cPadding*2
            }}>Card Description</div>
            <div style={{
                backgroundColor: 'peru',
                color: 'cornsilk',
                position: 'absolute',
                bottom: 0,
                height: cHeight*cHeadFoot-cPadding*2,
                width: cWidth-cPadding*2,
                padding: cPadding,
                textAlign: 'center',
            }}>Card Footer</div>
        </div>
    )
}

export default Card;
